import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import PictureCard from './components/PictureCard';
import Skills from './components/Skills';

function App() {
  return (
    <div className="App">
     <Header/>
     <Skills/>
     <PictureCard/>
    </div>
  );
}

export default App;
